package practice.algorithms;

public class LCS {
	public static int lcs[][] = new int[6000][6000];
	public static String trace[][] = new String[6000][6000];

	public static void main(String[] args) {
		String s1 = "";
		String s2 = "";
		System.out.println(s1.length());
		System.out.println(s2.length());
		s1 = " " + s1;
		s2 = " " + s2;
		int lengthOfLCS = lengthOfLCS(s1, s2);
		System.out.println(lengthOfLCS);
		printLCS(s1.length()-1, s2.length()-1, s1);
	}

	static void printLCS(int x, int y, String s1) {
		if (x != 0 && y != 0) {
			if (trace[x][y].equalsIgnoreCase("diag")) {
				printLCS(x - 1, y - 1, s1);
				System.out.print(s1.charAt(x));
			} else if (trace[x][y].equalsIgnoreCase("up")) {
				printLCS(x - 1,y, s1);
			}
			else
				printLCS(x, y-1, s1);
		}
	}

	static int lengthOfLCS(String s1, String s2) {
		int m = s1.length();
		int n = s2.length();
		for (int i = 1; i < m; i++) {
			for (int j = 1; j < n; j++) {
				if (s1.charAt(i) == s2.charAt(j)) {
					lcs[i][j] = lcs[i - 1][j - 1] + 1;
					trace[i][j] = "diag";
				} else if (lcs[i - 1][j] >= lcs[i][j - 1]) {
					lcs[i][j] = lcs[i - 1][j];
					trace[i][j] = "up";
				} else {
					lcs[i][j] = lcs[i][j - 1];
					trace[i][j] = "left";
				}
			}
		}
		return lcs[m - 1][n - 1];
	}
}
